import "bootstrap/dist/css/bootstrap.min.css";
import NavBar from "./Components/NavBar";
import { useState } from "react";

function App() {
  const [step, setStep] = useState(0);
  return (
    <NavBar>
      stepProp = {step} setStepProp = {setStep}
    </NavBar>
  );
}

export default App;
